import React from 'react';
import { SafeAreaView, StyleSheet, Text, View } from 'react-native';
import ListaMisterios from './src/views/ListaMisterios';
import ContemplacaoMisterios from './src/views/ContemplacaoMisterios';
import {NavigationContainer} from '@react-navigation/native';
import {createStackNavigator} from '@react-navigation/stack';

const Stack = createStackNavigator();
const config = {
  animation: 'spring',
  config: {
    stiffness: 1000,
    damping: 500,
    mass: 3,
    overshootClamping: true,
    restDisplacementThreshold: 0.01,
    restSpeedThreshold: 0.01,
  },
};

export default function App() {

  return (
    <NavigationContainer>
      <View style={styles.container}>
        <Stack.Navigator initialRouteName="ListaMisterios" 
        screenOptions={{gestureEnabled:true, gestureDirection: 'horizontal', transitionSpec:{open: config, close: config}}}>
          <Stack.Screen
            name="ListaMisterios"
            component={ListaMisterios}
            options={{headerShown: false}}
          />

          <Stack.Screen
            name="ContemplacaoMisterios"
            component={ContemplacaoMisterios}
            options={{headerShown: false}}
          />
        </Stack.Navigator>
      </View>
    </NavigationContainer>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#ffffff',
  }
});
